import React from 'react'
import {Link} from "react-router-dom"
import '../App.css'
// import BM from "./busMap"

class IotContent extends React.Component{ 

  constructor(props) {
      super(props);
      this.state = { dataArr: []};
    }

  async componentDidMount() {

    // const request = require('request');

    let url = "https://magellan.ais.co.th/asgardpullmessagesapis/api/listen/thing?Key=893747583B7E5DEF2297D252B52383DF";

    let options = {json: true};
    request(url, options, (error, res, body) => {
        if (error) {
            return  console.log(error)
        };

        if (!error && res.statusCode === 200) {
            // do something with JSON, using the 'body' variable
            this.setState({dataArr: body})
        };
    });
      
  }

   render(){
   return (
    <main className="main-content position-relative border-radius-lg ">
    <div className='App-overtable' id="style-1">
    <div className="container-fluid py-4 ">
        {this.state.data}
    </div>
    </div>
  </main>   
   )
   }
}

export default IotContent
